import Header from './components/Header/Header';
import NavBar from './components/Header/NavBar';
import AddDrugBtn from './components/OnlinePharmacy/AddDrugBtn';


import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import AddDrugForm from './components/OnlinePharmacy/AddDrugForm';



function App() {
  return (
    <Router>
      <div className="App">
          <Header/>
          <NavBar/>

          <Routes>
            <Route path='/onlinepharmacy' element={<AddDrugBtn/>}></Route>
            <Route path='/onlinepharmacy/addDrug' element={  <AddDrugForm/>}></Route>
          </Routes>

      </div>

    </Router>

  );
}

export default App;
